CREATE PROCEDURE dbo.proc_transform_382
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_382
    SET payload = LEFT(payload, 1000) + N'|V4-382|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_382;
END
